import './App.css';
import Header from '../header/header';
import FamousPerson from '../famousperson/famous'

class App extends Component {


  state = {
    famousPerson: {
      name: '',
      role: ''
    }
  }


  render() {
    return (
      <div className="App">
        <Header />
        <FamousPerson />
      </div>
    );
  }
}

export default App;
